import React from 'react';
import '../styles/index.css';

export default class Card extends React.Component{
    render(){
        return (
            <div className="card text-center">
                <div className='card-header text-muted'>Title</div> 
                <div className="card-body">
                    <img src={this.props.wheatherImagesun} className="card-img" alt="..." />
                </div>
                <div className="card-footer">
                    <span className="card-text">Cels </span>
                    <span className="card-text text-muted">Far</span>
                </div>    
            </div>
        )
    }
}
